import React, { useState } from 'react';
import ImportCSV from './components/ImportCSV';
import MLdropdown from './components/MLdropdown';
import ProgressBar from './components/ProgressBar';
import './App.css';

function App() {
  const [currentStep, setCurrentStep] = useState(0);
  const steps = ['Data', 'ML Model', 'Results', 'Dependency Graphs', 'ROI Analysis'];
  const pages = [ImportCSV, MLdropdown];

  const handleNext = () => {
    if (currentStep < steps.length - 1) {
      setCurrentStep(currentStep + 1);
    }
  };

  const handleOptionSelect = async (selectedValue) => {
    console.log('Selected option:', selectedValue);
    onModelSelect(selectedValue);

    if (selectedValue === 'logistic_regression') {
      try {
        const response = await axios.post('http://localhost:5000/logistic_regression', {
          trainData,
          testData,
        });
        console.log('Logistic regression response:', response.data);
        // Handle the response data as needed
      } catch (error) {
        console.error('Logistic regression error:', error);
        // Handle the error as needed
      }
    }
  };
  const CurrentPage = pages[currentStep];

  return (
    <div className="App">
      <header className="App-header">
        <div className="app-container">
          <ProgressBar steps={steps} currentStep={currentStep} onNext={handleNext} />
        </div>
      </header>
      <div className="App-content">
        {CurrentPage && (
          <CurrentPage onModelSelect={handleModelSelect} />
        )}
      </div>
    </div>
  );
}

export default App;
